Retains only the elements specified by the predicate.

In other words, remove all elements `e` such that `f(&e)` returns `false`.

# Examples

```
use hashbrown::HashSet;

let xs = [1,2,3,4,5,6];
let mut set: HashSet<i32> = xs.into_iter().collect();
set.retain(|&k| k % 2 == 0);
assert_eq!(set.len(), 3);
```
